import React from "react";
import { Link } from "react-router-dom";

function RobotList({ robots }) {
    return (
        <div className="robot-list">
            <h2>Robot List</h2>
            <ul>
                {robots.map((robot) => (
                    <li key={robot.id}>
                        <Link to={`/robot/${robot.id}`}>{robot.name}</Link>
                    </li>
                ))}
            </ul>
        </div>
    );
}
